import React from "react";

const Slotmachine = (props) => {
  let x = props.x;
  let y = props.y;
  let z = props.z;

  {
    x === y ? (
      <>
        <div className="slot_inner">
          <h1>
            {props.x}
            {props.y}
            {props.z}
          </h1>
          <h1>You Won</h1>
          <hr />
        </div>
      </>
    ) : (
      <>
        <div className="slot_inner">
          <h1>
            {props.x}
            {props.y}
            {props.z}
          </h1>
          <h1>you lost</h1>
          <hr />
        </div>
      </>
    );
  }
};
export default Slotmachine;
